# Example dictionary of some PMS color conversions to CMYK\n# Note: These are approximations and not official conversions.\npms_to_cmyk = {\n    'PMS 109': (86, 43, 36, 5),   # Apple Green\n    'PMS 293': (70, 3, 3, 28),     # Orange Red C\n    'PMS 356': (50, 19, 6, 47),    # Tomato Red\n}\n\ndef get_cmyk_from_pms(pms_color):\n    return pms_to_cmyk.get(pms_color, "Color not found in the database")\n\n# Example usage:\npms_color = 'PMS 293'\ncmyk_value = get_cmyk_from_pms(pms_color)\nprint(f"The approximate CMYK value for {pms_color} is {cmyk_value}")